import React from 'react';
import { NavLink } from 'react-router-dom';
import classes from './leftBar.module.css';
//import logo from '../../../public/images/logo.png'

const LeftBar = () => {
	return (
	<div className={classes.leftBar}>
			 {/* <div><img className= {classes.logo} alt={'Reliz-logo'}
			src= "/image.png"/> /
			</div> */}
	<nav className={classes.menu}>
		<div className={classes.menu_nav}>
			<div className={classes.item}>
				<NavLink to='/profile' activeClassName={classes.active}>Profile</NavLink>
			</div>
			<div className={classes.item}>
				<NavLink to='/offers' activeClassName={classes.active}>Offers</NavLink>
			</div>
			<div className={classes.item}>
				<NavLink to='/news' activeClassName={classes.active}>Creative Packs</NavLink>
			</div>
			<div className={classes.item}>
				<NavLink to='/music' activeClassName={classes.active}>Playable ABS</NavLink>
			</div>
			<div className={classes.item}>
				<NavLink to='/freelance' activeClassName={classes.active}>Freelance</NavLink>
			</div>
			<div className={classes.item}>
				<NavLink to='/questions' activeClassName={classes.active}>FAQ</NavLink>
			</div>
		</div>
	</nav>
	</div>
	)
}


export default LeftBar;
